// ==UserScript==
// @name         Memento mori
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  110 min every 5:00 am
// @author       You
// @match        https://www.youtube.com/*
// @icon         https://cdn.onlinewebfonts.com/svg/img_506248.png
// @grant        none
// ==/UserScript==
(function() {
    // Initialize variables
    let totalTimeElapsed, startTime;
    const alertThreshold = 75 * 60000;
    const midnightRefreshTime = 5;

    // Check if refresh is needed
    if (new Date() >= +(localStorage.getItem("Tomorrow") || 0)) {
        alert("Refresh");
        localStorage.setItem("TotalTime", 0);
    }

    // Set tomorrow's refresh time
    let tomorrow = new Date();
    tomorrow.setDate(tomorrow.getDate() + 1);
    tomorrow.setHours(midnightRefreshTime, 0, 0, 0);
    localStorage.setItem("Tomorrow", +tomorrow);

    // Retrieve total time and start time
    totalTimeElapsed = +(localStorage.getItem("TotalTime") || 0);
    startTime = +(new Date());

    // Function to display alerts
    function displayAlerts() {
        localStorage.setItem("TotalTime", alertThreshold);
        window.onbeforeunload = null;
        window.alerts = null;
        window.update = null;
        document.childNodes[1].innerHTML = `<title>Memento mori</title><link rel="shortcut icon" href="data:image/x-icon;base64," />`;
        document.childNodes[1].innerHTML += "To waste one's time is to waste one's life.";
        document.body.style.background = "black";
        document.body.style.color = "white";
        document.body.style['background-repeat'] = 'no-repeat';
        document.body.style['background-attachment'] = 'fixed';
        document.body.style['background-position'] = 'center';
        document.body.style.textAlign = "center";
        document.body.style.backgroundImage = `url('data:image/webp;base64,')`;
        document.querySelector("html").style['font-size'] = "42px";
    }

    // Event listener for storage changes
    window.addEventListener("storage", () => {
        let currentTotalTime = +(localStorage.getItem("TotalTime") || 0);
        setTimeout(() => {
            displayAlerts();
        }, alertThreshold - currentTotalTime);
    }, false);

    // Set timeouts for alerts and like button click
    setTimeout(() => {
        displayAlerts();
    }, alertThreshold - totalTimeElapsed);

    setTimeout(() => {
        let likeButton = document.querySelector("#segmented-like-button > ytd-toggle-button-renderer > yt-button-shape > button");
        if (likeButton.attributes['aria-label'].value.indexOf("like this") >= 0) {
            likeButton.click();
        }
    }, 60000);

    // Function to update the timer
    function updateTimer() {
        let currentTotalTime = +(localStorage.getItem("TotalTime") || 0);
        let timeDiff = +(new Date()) - startTime;
        if (totalTimeElapsed + timeDiff > currentTotalTime) {
            currentTotalTime = totalTimeElapsed + timeDiff;
        }
        let remainingTime = 75 - Math.round(currentTotalTime / 60000);
        document.querySelector("a > yt-icon-button > button > yt-icon").innerHTML = remainingTime;
        if (remainingTime !== 0) setTimeout(updateTimer, 60000);
    }

    // Call update function with timeout
    setTimeout(updateTimer, 5000);
})();
